import React, { useState } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Menu,
  MenuItem,
  Avatar,
  Box,
  Tooltip,
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  useMediaQuery,
  useTheme,
  Badge,
  Divider,
} from '@mui/material';
import {
  AccountCircle,
  Dashboard,
  Map,
  Home,
  Add,
  AdminPanelSettings,
  ExitToApp,
  Menu as MenuIcon,
  Notifications,
  Settings,
  SwapHoriz,
  Star,
  Diamond,
  EmojiEvents,
} from '@mui/icons-material';
import { useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));
  const { user, logout, isAdmin } = useAuth();
  const [anchorEl, setAnchorEl] = useState(null);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    logout();
    handleMenuClose();
    navigate('/login');
  };

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  const isActive = (path) => {
    return location.pathname === path || location.pathname.startsWith(path + '/');
  };

  const menuItems = [
    { label: 'Dashboard', path: '/dashboard', icon: <Dashboard />, color: '#FFD700' },
    { label: 'My Lands', path: '/lands', icon: <Home />, color: '#50C878' },
    { label: 'Transfers', path: '/transfers', icon: <SwapHoriz />, color: '#E0115F' },
    { label: 'Map View', path: '/map', icon: <Map />, color: '#B9F2FF' },
    { label: 'Register Land', path: '/register-land', icon: <Add />, color: '#E5E4E2' },
  ];

  if (isAdmin()) {
    menuItems.push({
      label: 'Admin Panel',
      path: '/admin',
      icon: <AdminPanelSettings />,
      color: '#FF6B35',
    });
  }

  return (
    <>
      <AppBar 
        position="sticky" 
        elevation={0}
        sx={{
          background: 'linear-gradient(135deg, rgba(12, 12, 12, 0.95) 0%, rgba(26, 26, 26, 0.9) 100%)',
          backdropFilter: 'blur(25px)',
          borderBottom: '1px solid rgba(255, 215, 0, 0.2)',
          boxShadow: '0 8px 32px rgba(0, 0, 0, 0.3)',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            height: '1px',
            background: 'linear-gradient(90deg, transparent, #FFD700, transparent)',
            opacity: 0.6,
          },
        }}
      >
        <Toolbar sx={{ py: 1, px: { xs: 2, sm: 3, md: 4 } }}>
          {isMobile && (
            <IconButton
              edge="start"
              onClick={toggleMobileMenu}
              sx={{
                mr: 2,
                color: 'rgba(255, 255, 255, 0.8)',
                '&:hover': {
                  background: 'rgba(255, 215, 0, 0.1)',
                  color: '#FFD700',
                },
              }}
            >
              <MenuIcon />
            </IconButton>
          )}

          <Box
            sx={{
              display: 'flex',
              alignItems: 'center',
              cursor: 'pointer',
              '&:hover': {
                transform: 'scale(1.05)',
              },
              transition: 'transform 0.3s ease',
            }}
            onClick={() => navigate('/dashboard')}
          >
            <Box
              sx={{
                width: 50,
                height: 50,
                borderRadius: '12px',
                background: 'linear-gradient(45deg, #FFD700, #FFA500)',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                mr: 2,
                boxShadow: '0 0 20px rgba(255, 215, 0, 0.4)',
                animation: 'pulse 2s ease-in-out infinite',
                '@keyframes pulse': {
                  '0%, 100%': { boxShadow: '0 0 20px rgba(255, 215, 0, 0.4)' },
                  '50%': { boxShadow: '0 0 30px rgba(255, 215, 0, 0.6)' },
                },
              }}
            >
              <Diamond sx={{ fontSize: '1.8rem', color: '#000' }} />
            </Box>
            <Typography
              variant="h5"
              sx={{
                fontFamily: 'Playfair Display, serif',
                fontWeight: 700,
                background: 'linear-gradient(45deg, #FFD700 30%, #E5E4E2 70%, #FFD700 90%)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
                display: { xs: 'none', sm: 'block' },
              }}
            >
              LuxuryLand
            </Typography>
          </Box>

          <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' }, justifyContent: 'center' }}>
            {menuItems.map((item) => (
              <Button
                key={item.path}
                onClick={() => navigate(item.path)}
                sx={{
                  mx: 1,
                  px: 2,
                  py: 1,
                  borderRadius: '12px',
                  textTransform: 'none',
                  fontWeight: 600,
                  color: isActive(item.path) ? '#000' : 'rgba(255, 255, 255, 0.8)',
                  background: isActive(item.path) 
                    ? `linear-gradient(45deg, ${item.color}, ${item.color}80)` 
                    : 'transparent',
                  border: `1px solid ${isActive(item.path) ? item.color : 'transparent'}`,
                  transition: 'all 0.3s ease',
                  '&:hover': {
                    background: isActive(item.path) 
                      ? `linear-gradient(45deg, ${item.color}, ${item.color}80)` 
                      : `rgba(255, 255, 255, 0.1)`,
                    border: `1px solid ${item.color}`,
                    transform: 'translateY(-2px)',
                    boxShadow: `0 8px 20px ${item.color}30`,
                  },
                }}
                startIcon={
                  <Box sx={{ color: isActive(item.path) ? '#000' : item.color }}>
                    {item.icon}
                  </Box>
                }
              >
                {item.label}
              </Button>
            ))}
          </Box>

          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
            <Tooltip title="Notifications">
              <IconButton
                sx={{
                  color: 'rgba(255, 255, 255, 0.8)',
                  '&:hover': {
                    background: 'rgba(255, 215, 0, 0.1)',
                    color: '#FFD700',
                  },
                }}
              >
                <Badge badgeContent={3} color="error">
                  <Notifications />
                </Badge>
              </IconButton>
            </Tooltip>

            <Tooltip title="Settings">
              <IconButton
                sx={{
                  color: 'rgba(255, 255, 255, 0.8)',
                  '&:hover': {
                    background: 'rgba(255, 215, 0, 0.1)',
                    color: '#FFD700',
                  },
                }}
              >
                <Settings />
              </IconButton>
            </Tooltip>

            <Box sx={{ display: 'flex', alignItems: 'center', cursor: 'pointer' }} onClick={handleMenuOpen}>
              <Box sx={{ textAlign: 'right', mr: 1, display: { xs: 'none', sm: 'block' } }}>
                <Typography variant="body2" sx={{ color: '#FFD700', fontWeight: 600 }}>
                  {user?.name || 'Premium User'}
                </Typography>
                <Typography variant="caption" sx={{ color: 'rgba(255, 255, 255, 0.6)' }}>
                  {isAdmin() ? 'Administrator' : 'Premium Member'}
                </Typography>
              </Box>
              <Avatar
                sx={{
                  width: 45,
                  height: 45,
                  background: 'linear-gradient(45deg, #FFD700, #FFA500)',
                  color: '#000',
                  fontWeight: 'bold',
                  border: '2px solid rgba(255, 215, 0, 0.3)',
                  '&:hover': {
                    transform: 'scale(1.1)',
                    boxShadow: '0 0 20px rgba(255, 215, 0, 0.4)',
                  },
                  transition: 'all 0.3s ease',
                }}
              >
                {isAdmin() ? <EmojiEvents /> : <Star />}
              </Avatar>
            </Box>
          </Box>
        </Toolbar>
      </AppBar>

      <Drawer
        anchor="left"
        open={mobileMenuOpen}
        onClose={toggleMobileMenu}
        sx={{
          '& .MuiDrawer-paper': {
            background: 'linear-gradient(135deg, rgba(12, 12, 12, 0.95) 0%, rgba(26, 26, 26, 0.9) 100%)',
            backdropFilter: 'blur(25px)',
            border: 'none',
            borderRight: '1px solid rgba(255, 215, 0, 0.2)',
            width: 280,
          },
        }}
      >
        <Box sx={{ p: 3 }}>
          <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
            <Box
              sx={{
                width: 40,
                height: 40,
                borderRadius: '10px',
                background: 'linear-gradient(45deg, #FFD700, #FFA500)',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                mr: 2,
              }}
            >
              <Diamond sx={{ fontSize: '1.5rem', color: '#000' }} />
            </Box>
            <Typography variant="h6" sx={{ color: '#FFD700', fontWeight: 700 }}>
              LuxuryLand
            </Typography>
          </Box>

          <Divider sx={{ mb: 3, borderColor: 'rgba(255, 215, 0, 0.2)' }} />

          <List>
            {menuItems.map((item) => (
              <ListItem
                key={item.path}
                sx={{
                  borderRadius: '15px',
                  mb: 1,
                  transition: 'all 0.3s ease',
                  cursor: 'pointer',
                  background: isActive(item.path) 
                    ? `linear-gradient(45deg, ${item.color}20, ${item.color}10)` 
                    : 'transparent',
                  border: `1px solid ${isActive(item.path) ? item.color + '40' : 'transparent'}`,
                  '&:hover': {
                    background: `rgba(255, 215, 0, 0.1)`,
                    transform: 'translateX(5px)',
                  },
                }}
                onClick={() => {
                  navigate(item.path);
                  setMobileMenuOpen(false);
                }}
              >
                <ListItemIcon sx={{ color: item.color, minWidth: 40 }}>
                  {item.icon}
                </ListItemIcon>
                <ListItemText 
                  primary={item.label}
                  sx={{
                    '& .MuiListItemText-primary': {
                      color: isActive(item.path) ? '#FFD700' : 'rgba(255, 255, 255, 0.9)',
                      fontWeight: isActive(item.path) ? 700 : 500,
                    },
                  }}
                />
              </ListItem>
            ))}
          </List>
        </Box>
      </Drawer>

      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleMenuClose}
        PaperProps={{
          sx: {
            background: 'linear-gradient(135deg, rgba(12, 12, 12, 0.95) 0%, rgba(26, 26, 26, 0.9) 100%)',
            backdropFilter: 'blur(25px)',
            border: '1px solid rgba(255, 215, 0, 0.2)',
            borderRadius: '15px',
            mt: 1,
            minWidth: 200,
          },
        }}
      >
        <MenuItem
          onClick={() => {
            navigate('/profile');
            handleMenuClose();
          }}
          sx={{
            color: 'rgba(255, 255, 255, 0.9)',
            '&:hover': {
              background: 'rgba(255, 215, 0, 0.1)',
              color: '#FFD700',
            },
          }}
        >
          <AccountCircle sx={{ mr: 1, color: '#FFD700' }} />
          Profile
        </MenuItem>
        <Divider sx={{ borderColor: 'rgba(255, 215, 0, 0.2)' }} />
        <MenuItem
          onClick={handleLogout}
          sx={{
            color: 'rgba(255, 255, 255, 0.9)',
            '&:hover': {
              background: 'rgba(255, 215, 0, 0.1)',
              color: '#FFD700',
            },
          }}
        >
          <ExitToApp sx={{ mr: 1, color: '#E0115F' }} />
          Logout
        </MenuItem>
      </Menu>
    </>
  );
};

export default Navbar;
